    [],nt"num_tags": 3,nt"name": "monte-vista-national-wildlife-refuge-narrative-report-january-to-april-1961",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Monte Vista National
    Wildlife Refuge outlines Refuge accomplishments from January through April of 1961.
    The report begins by summarizing the weather conditions, water conditions, and food
    and cover during this period. Wildlife- including migratory birds, upland game birds,
    furbearers, predators, rodents, mammals, raptors, and fish- is also covered. The
    Refuge development and maintenance section discusses physical developments, plantings,
    and collections and receipts. Resource management is outlined; topics include grazing,
    haying, and fur harvesting. A progress report on field investigations and applied
    research is also provided. The public relations section of the report describes
    recreational uses, Refuge visitors, Refuge participation, hunting, and violations.
    N-R forms are attached",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
